create table sys_user
(
    user_id      bigint unsigned auto_increment comment '用户ID'
        primary key,
    user_name    varchar(30)              null comment '用户名',
    nick_name    varchar(30)              null comment '用户昵称',
    email        varchar(50)  default ''  null comment '用户邮箱',
    phone_number varchar(11)  default ''  null comment '手机号码',
    age          tinyint unsigned         null comment '年龄',
    sex          char         default '0' null comment '用户性别（0 男，1女，2未知）',
    avatar       varchar(100) default ''  null comment '头像地址',
    password     varchar(100) default ''  null comment '密码',
    status       char         default '0' null comment '账号状态（0 正常，1 停用）',
    del_flag     char         default '0' null comment '删除标志（0 代表存在，1 代表删除）',
    login_ip     varchar(128) default ''  null comment '最后登录IP',
    login_date   datetime(3)              null comment '最后登录时间',
    create_by    varchar(64)  default ''  null comment '创建者',
    create_time  datetime(3)              null comment '创建时间',
    update_by    varchar(64)  default ''  null comment '更新者',
    update_time  datetime(3)              null comment '更新时间',
    remark       varchar(500)             null comment '备注'
)
    comment '用户信息表';

